        private void button7_Click(global::System.Object sender, global::System.EventArgs e)
        {
            //EXPORT BUTTON DGV2 to CSV


            try
            {
                var fDialog = new SaveFileDialog();
                fDialog.Filter = "csv Files (*.csv,*.csv)|*.csv;*.csv";
                if (fDialog.ShowDialog() == DialogResult.OK && !string.IsNullOrEmpty(fDialog.FileName))
                {
                    StreamWriter sw = new StreamWriter(fDialog.FileName);
                    for (int i = 0; i < dataGridView2.Columns.Count; i++)
                    {
                        sw.Write(dataGridView2.Columns[i].HeaderText);
                        sw.Write(",");
                    }
                    sw.Write(sw.NewLine);
                    foreach (DataGridViewRow dr in dataGridView2.Rows)
                    {
                        for (int i = 0; i < dataGridView2.Columns.Count; i++)
                        {
                            sw.Write(dr.Cells[i].Value);
                            sw.Write(",");
                        }
                        sw.Write(sw.NewLine);
                    }
                    sw.Close();
                }
            }
            catch (Exception ex)
            {
                throw ex;
            }

        }

