                    {
                        for (int i = 0; i < dataGridView9.Columns.Count; i++)
                        {
                            sw.Write(dr.Cells[i].Value);
                            sw.Write(",");
                        }
                        sw.Write(sw.NewLine);
                    }
                    sw.Close();
                }
            }
            catch (Exception ex)
            {
