            }
        }

        private void button21_Click(global::System.Object sender, global::System.EventArgs e)
        {
            //DGV10 TO CSV

            try
            {
                var fDialog = new SaveFileDialog();
                fDialog.Filter = "csv Files (*.csv,*.csv)|*.csv;*.csv";
                if (fDialog.ShowDialog() == DialogResult.OK && !string.IsNullOrEmpty(fDialog.FileName))
                {
                    StreamWriter sw = new StreamWriter(fDialog.FileName);
                    for (int i = 0; i < dataGridView10.Columns.Count; i++)
                    {
                        sw.Write(dataGridView10.Columns[i].HeaderText);
                        sw.Write(",");
                    }
                    sw.Write(sw.NewLine);
                    foreach (DataGridViewRow dr in dataGridView10.Rows)
                    {
                        for (int i = 0; i < dataGridView10.Columns.Count; i++)
                        {
                            sw.Write(dr.Cells[i].Value);
                            sw.Write(",");
                        }
                        sw.Write(sw.NewLine);
                    }
                    sw.Close();
                }
            }
            catch (Exception ex)
            {
                throw ex;
            }
        }
